import { Rate } from 'antd';
import React from 'react';

class RatingResult extends React.Component{
    constructor(props){
        super(props);
        this.state={};
    }
    render(){
        let rating = this.props.rating - 0;
        console.log(rating);
        return (
            <div>
                <Rate disabled allowHalf defaultValue={rating} />
            </div>
        )
    }
}
export default RatingResult;
